-aktif:','Active Modules:'=>'Modul Aktif:','PublishPress Permissions Version: %1$s %2$s'=>'Versi PublishPress Permissions: %1$s %2$s','A presspermit.com key appears to be active. <a href="%s" target="_blank">Contact us</a> for assistance in migrating your account to publishpress.com.'=>'Sebuah kunci presspermit.com tampaknya aktif. <a href="%s" target="_blank">Hubungi kami</a> untuk bantuan dalam memindahkan akun Anda ke publishpress.com','Modules'=>'Modul','Upgrade to Pro'=>'Upgrade ke Pro','PublishPress Permissions'=>'PublishPress Permissions','To block direct URL access to attachments of unreadable posts, %1$supgrade to Permissions Pro%2$s and enable the File Access module.'=>'Untuk memblokir akses URL langsung ke lampiran dari pos yang tidak dapat dibaca, %1$supgrade ke Permissions Pro%2$s dan aktifkan modul Akses File.','To assign roles for bbPress forums, %1$supgrade to Permissions Pro%2$s and enable the Compatibility Pack module.'=>'Untuk menetapkan peran untuk forum bbPress, %1$supgrade ke Permissions Pro%2$s dan aktifkan modul Compatibility Pack.','To assign roles for custom post statuses, %1$supgrade to Permissions Pro%2$s and enable the Status Control module.'=>'Untuk menetapkan peran untuk status pos kustom, %1$supgrade ke Permissions Pro%2$s dan aktifkan modul Kontrol Status.','To define custom privacy statuses, %1$supgrade to Permissions Pro%2$s and enable the Status Control module.'=>'Untuk menentukan status privasi kustom, %1$supgrade ke Permissions Pro%2$s dan aktifkan modul Kontrol Status.','To assign roles or permissions to BuddyPress groups, %1$supgrade to Permissions Pro%2$s and enable the Compatibility Pack module.'=>'Untuk menetapkan peran atau izin ke grup BuddyPress, %1$supgrade ke Permissions Pro%2$s dan aktifkan modul Kompatibilitas.','<strong>This plugin can be deleted.</strong>'=>'<strong>Plugin ini dapat dihapus.</strong>','%1$s won&#39;t work until you upgrade PHP to version %2$s or later. Current version: %3$s'=>'%1$s tidak akan berfungsi sampai Anda meningkatkan PHP ke versi %2$s atau yang lebih baru. Versi saat ini: %3$s','%s&nbsp;details'=>'%s&nbsp;detail','Original presspermit.com support key hash: <strong>%s</strong>'=>'Hash kunci dukungan asli presspermit.com: <strong>%s</strong>','Original presspermit.com support key hash: <strong>%s</strong> (expires %s)'=>'Hash kunci dukungan asli presspermit.com: <strong>%s</strong> (berakhir pada %s)','Further details for your installation:'=>'Detail lebih lanjut untuk instalasi Anda:','Your presspermit.com key has expired, but a <a href="%s">PublishPress renewal</a> discount may be available.'=>'Kunci presspermit.com Anda telah kedaluwarsa, tetapi diskon <a href="%s">perpanjangan PublishPress</a> mungkin tersedia.','Account'=>'Akun','Regulate permissions for PublishPress post statuses'=>'Regulasi izin untuk status pos PublishPress','To assign roles or permissions to BuddyPress groups, activate the Compatibility Pack module'=>'Untuk menetapkan peran atau izin ke grup BuddyPress, aktifkan modul Kompatibilitas','All settings were updated.'=>'Semua pengaturan telah diperbarui.','To assign roles for custom post statuses, activate the Status Control module.'=>'Untuk menetapkan peran untuk status pos kustom, aktifkan modul Kontrol Status.','To block direct access to unreadable files, %1$supgrade to Permissions Pro%2$s and install the File Access module.'=>'Untuk memblokir akses langsung ke file yang tidak dapat dibaca, %1$supgrade ke Permissions Pro%2$s dan instal modul Akses File.','To block direct access to unreadable files, activate the File Access module.'=>'Untuk memblokir akses langsung ke file yang tidak dapat dibaca, aktifkan modul Akses File.','To define custom privacy statuses, activate the Status Control module.'=>'Untuk menentukan status privasi kustom, aktifkan modul Kontrol Status.','https://publishpress.com/presspermit'=>'https://publishpress.com/presspermit','Development use only (on front end, do not replace \'post_status = \'publish\'\' clause with filtered equivalent)'=>'Hanya untuk penggunaan pengembangan (di frontend, jangan menggantikan klausa \'post_status = \'publish\'\' dengan setara yang difilter)','Development use only (suppresses post_status = \'publish\' clause for unfiltered post types with anonymous user)'=>'Hanya untuk penggunaan pengembangan (menekan klausa post_status = \'publish\' untuk jenis pos yang tidak difilter dengan pengguna anonim)','Reduce overhead of wp-admin query for specified custom post type by defaulting fields to a set list that does not include post_content '=>'Kurangi beban kueri wp-admin untuk jenis pos kustom tertentu dengan memberikan nilai default ke daftar yang tidak termasuk post_content ','Reduce overhead of wp-admin Media query by defaulting fields to a set list that does not include post_content '=>'Kurangi beban kueri wp-admin Media dengan memberikan nilai default ke daftar yang tidak termasuk post_content ','Reduce overhead of wp-admin posts query by defaulting fields to a set list that does not include post_content '=>'Kurangi beban kueri wp-admin pos dengan memberikan nilai default ke daftar yang tidak termasuk post_content ','Reduce overhead of pages query (in get_pages() and wp-admin) by defaulting fields to a set list that does not include post_content '=>'Kurangi beban kueri halaman (dalam get_pages() dan wp-admin) dengan memberikan nilai default ke daftar yang tidak termasuk post_content ','Attached media do not have any comments, so don\'t append clauses to comment queries for them'=>'Media terlampir tidak memiliki komentar, jadi jangan tambahkan klausa ke kueri komentar untuk mereka','To save memory on front end access, don\'t register any filters related to content editing'=>'Untuk menghemat memori pada akses frontend, jangan mendaftarkan filter terkait pengeditan konten','Force detection of WP user roles which are appended dynamically but not stored to the WP database.'=>'Paksa deteksi peran pengguna WP yang ditambahkan secara dinamis tetapi tidak disimpan ke database WP.','When synchronizing role metagroups to currently defined WP roles, don\'t delete groups for previously defined WP roles.'=>'Saat menyinkronkan metagrup peran ke peran WP yang saat ini ditentukan, jangan hapus grup untuk peran WP yang sudah ditentukan sebelumnya.','Use display name for search results instead of user_login'=>'Gunakan nama tampilan untuk hasil pencarian alih-alih user_login','User meta fields which should be treated as boolean (comma-separated)'=>'Bidang meta pengguna yang harus dianggap sebagai boolean (dipisahkan koma)','User meta fields which should be treated as numeric (comma-separated)'=>'Bidang meta pengguna yang harus dianggap sebagai numerik (dipisahkan koma)','User meta fields selectable for search (comma-separated)'=>'Bidang meta pengguna yang dapat dipilih untuk pencarian (dipisahkan koma)','User field to search by default'=>'Bidang pengguna untuk dicari secara default','Search by last name instead of display name'=>'Cari berdasarkan nama belakang alih-alih nama tampilan','Make search function on the post selection metabox look at post excerpt'=>'Buat fungsi pencarian pada kotak seleksi pos melihat cuplikan pos','Make search function on the post selection metabox look at post content'=>'Buat fungsi pencarian pada kotak seleksi pos melihat konten pos','Target number of visible pages/terms, used for auto-determination of number of visible levels'=>'Jumlah target halaman/istilah yang terlihat, digunakan untuk penentuan otomatis jumlah tingkat yang terlihat','Disable auto-determination of how many levels of page tree to make visble by default. Instead, use specified value.'=>'Nonaktifkan penentuan otomatis berapa banyak tingkat pohon halaman yang terlihat secara default. Sebaliknya, gunakan nilai yang ditentukan.','Max number of hierarchical posts / terms to display at one time (per page)'=>'Jumlah maksimum pos/istilah hirarkis yang akan ditampilkan sekaligus (per halaman)','Max number of non-hierarchical posts / terms to display at one time (per page)'=>'Jumlah maksimum pos/istilah non-hirarkis yang akan ditampilkan sekaligus (per halaman)','Customize description under \'Permission Groups\' caption '=>'Sesuaikan deskripsi di bawah keterangan \'Kelompok Izin\' ','Customize \'Permission Groups\' caption on user profile'=>'Sesuaikan keterangan \'Kelompok Izin\' pada profil pengguna','Customize \'Permission Groups\' caption'=>'Sesuaikan keterangan \'Kelompok Izin\'','Don\'t add a Permissions menu. Instead, add menu items to the Users and Settings menus.'=>'Jangan tambahkan menu Izin. Sebaliknya, tambahkan item menu ke menu Pengguna dan Pengaturan.','Don\'t tweak the admin menu indexes to position Permissions menu under Users'=>'Jangan menyesuaikan indeks menu admin untuk menempatkan menu Izin di bawah Pengguna','Max number of specific permissions to insert in a single database query (default 1000)'=>'Jumlah maksimum izin khusus yang akan dimasukkan dalam satu kueri database (default 1000)','If propagating permissions are assigned to a page branch, overwrite any explicitly assigned permissions in sub-pages'=>'Jika izin penyebaran ditugaskan ke cabang halaman, timpa semua izin yang ditugaskan secara eksplisit di sub-halaman','Don\'t filter comment display or moderation within wp-admin'=>'Jangan menyaring tampilan atau moderasi komentar dalam wp-admin','Unlock Permissions > Settings > Core > Admin Back End > \'Hide non-editable posts\''=>'Buka kunci Permissions > Pengaturan > Inti > Admin Back End > \'Sembunyikan pos yang tidak dapat diedit\'','On Users listing, Permission groups in custom column are list filter links instead of group edit links'=>'Pada daftar Pengguna, kelompok Izin dalam kolom kustom adalah tautan filter daftar alih-alih tautan edit grup','Leave Media Library with normal access criteria based on user\'s role capabilities '=>'Biarkan Media Library dengan kriteria akses normal berdasarkan kapabilitas peran pengguna ','Never modify the parent value in the get_terms() result set, even if some terms have been suppressed'=>'Jangan pernah memodifikasi nilai induk dalam set hasil get_terms(), bahkan jika beberapa istilah telah dibatasi','If some terms have been suppressed from get_terms() results, change child terms\' corresponding parent values to a visible ancestor'=>'Jika beberapa istilah telah dibatasi dari hasil get_terms(), ubah nilai induk yang sesuai dengan istilah anak ke leluhur yang terlihat','For performance, change the get_pages() database query to return only a subset of fields, excluding post_content'=>'Untuk kinerja, ubah kueri database get_pages() untuk mengembalikan hanya subset bidang, tidak termasuk post_content','Never modify the post_parent value in the get_pages() result set, even if some pages have been suppressed'=>'Jangan pernah memodifikasi nilai post_parent dalam set hasil get_pages(), bahkan jika beberapa halaman telah dibatasi','If some pages have been suppressed from get_pages() results, change child pages\' corresponding post_parent values to a visible ancestor'=>'Jika beberapa halaman telah dibatasi dari hasil get_pages(), ubah nilai post_parent yang sesuai dengan halaman anak ke leluhur yang terlihat','Don\'t include readable private pages in the Pages widget or other wp_list_pages() / get_pages() results    '=>'Jangan termasuk halaman pribadi yang dapat dibaca dalam widget Halaman atau hasil lainnya dari wp_list_pages() / get_pages()    ','Filter priority for \'get_pages\' filter (default: 1)'=>'Prioritas penyaringan untuk filter \'get_pages\' (default: 1)','Leave terms with no readable posts on WP Navigation Menus'=>'Biarkan term tanpa kiriman yang dapat dibaca pada Menu Navigasi WP','Leave unreadable posts on WP Navigation Menus'=>'Biarkan kiriman yang tidak dapat dibaca pada Menu Navigasi WP','Don\'t filter term post counts in get_terms() call'=>'Jangan menyaring hitungan kiriman term dalam panggilan get_terms()','Include scheduled posts in the posts query if user can edit them'=>'Sertakan kiriman terjadwal dalam kueri kiriman jika pengguna dapat mengeditnya','Don\'t assign or apply specific permissions for the specified custom post type'=>'Jangan menetapkan atau menerapkan izin khusus untuk jenis kiriman kustom yang ditentukan','Comma-separated list of post types to limit the effect of PP_UNFILTERED_FRONT and apply_filters( \'presspermit_skip_cap_filtering\' )'=>'Daftar jenis kiriman yang dipisahkan koma untuk membatasi efek PP_UNFILTERED_FRONT dan apply_filters(\'presspermit_skip_cap_filtering\')','Disable front end filtering for all users (subject to limitation by PP_UNFILTERED_FRONT_TYPES)'=>'Nonaktifkan penyaringan depan untuk semua pengguna (tergantung pada pembatasan oleh PP_UNFILTERED_FRONT_TYPES)','Disable front end filtering if logged user is a content administrator (normally filter to force inclusion of readable private posts in get_pages() listing, post counts, etc.'=>'Nonaktifkan penyaringan depan jika pengguna yang masuk adalah administrator konten (biasanya menyaring untuk memaksa inklusi kiriman pribadi yang dapat dibaca dalam daftar get_pages(), hitungan kiriman, dll.)','Allow the {All} and {Anonymous} metagroups to be granted specific reading permissions for private content'=>'Izinkan metagrup {Semua} dan {Anonymous} diberikan izin baca khusus untuk konten pribadi','Supplemental roles assignment available for {All} and {Anonymous} metagroups'=>'Penugasan peran tambahan tersedia untuk metagrup {Semua} dan {Anonymous}','Sorry, you are not allowed to do that.'=>'Maaf, Anda tak dizinkan melakukannya.','Search Groups'=>'Cari Grup','Search Results for &#8220;%s&#8221;'=>'Hasil Pencarian untuk &#8220;%s&#8221;','%1$sGroup Type:%2$s %3$s'=>'%1$sTipe Grup:%2$s %3$s','Custom Group'=>'Grup Khusus','New group created.'=>'Grup baru telah dibuat.','%s group deleted'=>'Grup "%s" dihapus' . "\0" . 'Grup "%s" dihapus','There are no valid groups selected for deletion.'=>'Tidak ada grup yang valid yang dipilih untuk dihapus','Confirm Deletion'=>'Konfirmasi