imary role or %2$sgroup membership%3$s)%4$s'=>'Peran Tambahan %1$s(dari peran utama atau %2$smembership grup%3$s)%4$s','Update Group'=>'Perbarui Grup','Primary Role:'=>'Peran Utama:','Name:'=>'Nama:','User Login:'=>'Login Pengguna:','Edit Permissions (%s)'=>'Edit izin (%s)','Edit Permission Group'=>'Edit Izin Grup','Add User Permissions'=>'Tambah Izin Pengguna','Edit User Permissions'=>'Edit Izin Pengguna','Group created.'=>'Grup dibuat.','Back to groups list'=>'Kembali ke daftar grup','Group updated.'=>'Perbarui Grup.','Permissions cloned.'=>'Permisi diduplikasi.','Roles updated.'=>'Peran diperbarui.','Invalid group ID.'=>'ID grup tidak valid.','Invalid user ID.'=>'ID pengguna tidak valid.','No user/group specified.'=>'Tidak ada pengguna/grup didefinisikan.','No results found.'=>'Tak ditemukan hasil apapun.','No items selected!'=>'Tidak ada item yang dipilih!','Reload form for further changes to this permission'=>'Muat ulang formulir untuk perubahan lebih lanjut pada izin ini','Reload form for further changes to this role'=>'Muat ulang formulir untuk perubahan lebih lanjut pada peran ini','Role submission in progress...'=>'Pengajuan peran sedang berlangsung...','No Action selected!'=>'Tidak ada tindakan yang dipilih!','Role already selected!'=>'Peran sudah dipilih!','Review selection(s) below, then click Save.'=>'Periksa pilihan di bawah ini, lalu klik Simpan.','No statuses selected!'=>'Tidak ada status yang dipilih!','Add Roles'=>'Tambahkan Peran','You can&#8217;t delete that group.'=>'Anda tidak dapat menghapus grup itu.','To customize editing permissions, enable the Collaborative Publishing module.'=>'Untuk menyesuaikan izin penyuntingan, aktifkan modul Publikasi Kolaboratif.','Reading'=>'Membaca','Read'=>'Baca','Note: BuddyPress Groups and other externally defined groups are not listed here, even if they modify permissions'=>'Catatan: Grup BuddyPress dan grup lain yang didefinisikan eksternal tidak terdaftar di sini, bahkan jika memodifikasi izin','add / edit membership'=>'tambah / ubah keanggotaan','Edit this user\'s group membership'=>'Ubah keanggotaan grup pengguna ini','This user is not a member of any custom Permission Groups.'=>'Pengguna ini bukan anggota dari kelompok Izin Kustom apa pun.','Permission Groups'=>'Grup Izin','Supplemental Roles %1$s(from primary role or group membership)%2$s'=>'Peran Tambahan %1$s(dari peran utama atau keanggotaan grup)%2$s','Supplemental Roles %1$s(for this user)%2$s'=>'Peran Tambahan %1$s(untuk pengguna ini)%2$s','Supplemental roles and specific permissions assigned to a user\'s primary role or other Permission Groups are usually the cleanest way to customize permissions.  You can also %1$scustomize this user directly%2$s.'=>'Peran tambahan dan izin khusus yang diberikan kepada peran utama atau Grup Izin lainnya biasanya adalah cara yang bersih untuk menyesuaikan izin. Anda juga bisa %1$sMensyesuaikan pengguna ini secara langsung%2$s.','Custom User Permissions'=>'Izin Pengguna Kustom','%sNote%s: If you don\'t see the Roles column on the Users screen, make sure it is enabled in Screen Options. '=>'%sCatatan%s: Jika Anda tidak melihat kolom Peran di layar Pengguna, pastikan itu diaktifkan dalam Opsi Layar. ','%1$sUsers who have Supplemental Roles or Specific Permissions (directly or via group)%2$s'=>'%1$sPengguna yang memiliki Peran Tambahan atau Izin Khusus (langsung atau melalui grup)%2$s','%1$sUsers who have Supplemental Roles (directly or via group)%2$s'=>'%1$sPengguna yang memiliki Peran Tambahan (langsung atau melalui grup)%2$s','%1$sUsers who have Supplemental Roles or Specific Permissions directly%2$s'=>'%1$sPengguna yang memiliki Peran Tambahan atau Izin Khusus secara langsung%2$s','%1$sUsers who have Supplemental Roles assigned directly%2$s'=>'%1$sPengguna yang memiliki Peran Tambahan secara langsung%2$s','%1$sUsers who have no custom Permission Group membership%2$s'=>'%1$sPengguna yang tidak memiliki keanggotaan Grup Izin kustom%2$s','User Permissions'=>'Izin Pengguna','Block URL access'=>'Blok Akses URL','To block direct URL access to attachments of unreadable posts, activate the File Access module.'=>'Untuk memblokir akses URL langsung ke lampiran dari posting yang tidak dapat dibaca, aktifkan modul Akses Berkas.','<strong>ERROR</strong>: This group name is already registered. Please choose another one.'=>'<strong>ERROR</strong>: Nama grup ini sudah terdaftar. Silakan pilih yang lain.','<strong>ERROR</strong>: Please enter a group name.'=>'<strong>ERROR</strong>: Silakan masukkan nama grup.','You are not permitted to do that.'=>'Anda tidak diizinkan untuk melakukannya.','To force the value of one or more settings network-wide, <strong>copy</strong> the following code into your theme\'s <strong>functions.php</strong> file (or some other file which is always executed and not auto-updated) and modify as desired:'=>'Untuk memaksa nilai satu atau lebih pengaturan di seluruh jaringan, <strong>salin</strong> kode berikut ke file <strong>functions.php</strong> tema Anda (atau file lain yang selalu dieksekusi dan tidak diperbarui otomatis) dan modifikasi sesuai keinginan:','To modify one or more default settings network-wide, <strong>copy</strong> the following code into your theme\'s <strong>functions.php</strong> file (or some other file which is always executed and not auto-updated) and modify as desired:'=>'Untuk memodifikasi satu atau lebih pengaturan default di seluruh jaringan, <strong>salin</strong> kode berikut ke file <strong>functions.php</strong> tema Anda (atau file lain yang selalu dieksekusi dan tidak diperbarui otomatis) dan modifikasi sesuai keinginan:','Available Constant'=>'Konstan Tersedia','Setting'=>'Pengaturan','Defined Constant'=>'Konstan Didefinisikan','Detect user roles which are appended dynamically but not stored to the WP database. May be useful for sites that sync with Active Directory or other external user registration systems.'=>'Deteksi peran pengguna yang ditambahkan secara dinamis tetapi tidak disimpan dalam database WP. Mungkin berguna untuk situs yang disinkronkan dengan Active Directory atau sistem registrasi pengguna eksternal lainnya.','Set Read Permissions for specific posts on Edit Post/Term screen (for non-Administrators lacking edit_users capability; may be disabled by Permissions Settings)'=>'Atur Izin Baca untuk posting tertentu di layar Edit Post/Term (untuk non-Administrator yang tidak memiliki kemampuan edit_users; dapat dinonaktifkan oleh Pengaturan Izin)','Assign Supplemental Roles or Specific Permissions. Other capabilities may also be required.'=>'Tetapkan Peran Tambahan atau Izin Khusus. Kemampuan lain juga mungkin diperlukan.','If group editing is allowed, can also modify group membership'=>'Jika pengeditan grup diizinkan, juga dapat memodifikasi keanggotaan grup','Can delete Permission Groups'=>'Dapat menghapus Grup Izin','Can create Permission Groups'=>'Dapat membuat Grup Izin','PublishPress Permissions implicitly grants capabilities for all post types and statuses, but does not apply Specific Permissions'=>'PublishPress Permissions secara implisit memberikan kemampuan untuk semua jenis dan status posting, tetapi tidak menerapkan Izin Khusus','PublishPress Permissions does not apply any Supplemental Roles or Specific Permissions to limit or expand viewing or editing access'=>'PublishPress Permissions tidak menerapkan Peran Tambahan atau Izin Khusus apa pun untuk membatasi atau memperluas akses melihat atau mengedit','Description'=>'Deskripsi','Capability Name'=>'Nama Kemampuan','Display descriptive captions for additional functionality provided by missing or deactivated modules (Permissions Pro package).'=>'Tampilkan keterangan deskriptif untuk fungsionalitas tambahan yang diberikan oleh modul yang hilang atau dinonaktifkan (paket Permissions Pro).','Display additional descriptions in role assignment and options UI.'=>'Tampilkan deskripsi tambahan dalam tugas peran dan UI opsi.','Display a role dropdown alongside the user search input box to narrow results.'=>'Tampilkan dropdown peran di sebelah kotak input pencarian pengguna untuk mempersempit hasil.','If enabled, users with the pp_set_read_exceptions capability in the WP role can set reading permissions for their editable posts.'=>'Jika diaktifkan, pengguna dengan kemampuan pp_set_read_exceptions dalam peran WP dapat menetapkan izin baca untuk posting yang dapat diedit mereka.','If checked, pages blocked from the "All" or "Logged In" groups will still be listed to Administrators.'=>'Jika dicentang, halaman yang diblokir dari grup "Semua" atau "Masuk" masih akan terdaftar untuk Administrator.','Most sites don\'t need advanced settings. But enable them if you need to work with custom WP Roles or apply performance tweaks.'=>'Sebagian besar situs tidak memerlukan pengaturan lanjutan. Tetapi aktifkan jika Anda perlu bekerja dengan Peran WP kustom atau menerapkan penyesuaian kinerja.','Note: if you disable these settings, the stored values (including Role Usage adjustments) are retained but ignored.'=>'Catatan: jika Anda menonaktifkan pengaturan ini, nilai yang disimpan (termasuk penyesuaian Penggunaan Peran) tetap dipertahankan tetapi diabaikan.','Bulk Add / Remove Groups on Users Screen'=>'Tambahkan / Hapus Grup Massal pada Layar Pengguna','Non-Administrators can set Reading Permissions for their editable posts'=>'Non-Administrator dapat menetapkan Izin Membaca untuk posting yang dapat diedit mereka','Detect Dynamically Mapped WP Roles'=>'Deteksi Peran WP yang Dipetakan Secara Dinamis','Display Administrative Hints'=>'Tampilkan Petunjuk Administratif','User Search: Filter by WP role'=>'Pencarian Pengguna: Saring berdasarkan peran WP','%1$sDisable%2$s all filtering for anonymous users'=>'%1$sNonaktifkan%2$s semua penyaringan untuk pengguna anonim','Enable advanced settings'=>'Aktifkan pengaturan lanjutan','Miscellaneous'=>'Lainnya','Constants'=>'Konstan','Role Integration'=>'Integrasi Peran','%s capabilities'=>'%s kemampuan','Permissions Admin'=>'Admin Izin',