rms only'=>'Tetapkan hanya untuk sub-istilah','Assign for selected term only'=>'Tetapkan hanya untuk istilah yang dipilih','Assign for selected and sub-terms'=>'Tetapkan untuk yang dipilih dan sub-istilah','Assign for sub-%s only'=>'Tetapkan hanya untuk sub-%s','Assign for selected %s only'=>'Tetapkan hanya untuk %s yang dipilih','Assign for selected and sub-%s'=>'Tetapkan untuk yang dipilih dan sub-%s','edit'=>'sunting','%s:'=>'%s:','* %s'=>'* %s','%1$s (%2$s)'=>'%1$s (%2$s)','unpublished'=>'belum dipublikasikan','%1$s %2$s'=>'%1$s %2$s','%1$s %2$s %3$s'=>'%1$s %2$s %3$s','%1$s (%2$s: %3$s)'=>'%1$s (%2$s: %3$s)','(all post types)'=>'(semua jenis artikel)','(none)'=>'(tidak ada)','Apply'=>'Terapkan','%s Roles'=>'%s Peran','Disabled Type'=>'Tipe Dinonaktifkan','Direct-Assigned'=>'Ditugaskan Langsung','objects'=>'objek','Term Management'=>'Manajemen Istilah','Supplemental Roles'=>'Peran Tambahan','Supplemental Roles %1$s(for user)%2$s'=>'Peran Tambahan %1$s(untuk pengguna)%2$s','Add Supplemental Roles'=>'Tambahkan Peran Tambahan','Clone'=>'Duplikasi','clear'=>'bersihkan','Operation'=>'Operasi','Save Roles'=>'Simpan Peran','Status'=>'Status','Select %s'=>'Pilih %s','To assign page-specific Permissions for editing, parent selection or term assignment, enable the Collaborative Publishing module.'=>'Untuk menetapkan Izin khusus halaman untuk pengeditan, pemilihan induk, atau penugasan istilah, aktifkan modul Publikasi Kolaboratif.','Warning: Content hidden by these Permissions will be displayed if PP is deactivated. Consider setting a private Visibility on Edit Post screen instead.'=>'Peringatan: Konten yang disembunyikan oleh Izin ini akan ditampilkan jika PP dinonaktifkan. Pertimbangkan untuk mengatur Visibilitas pribadi pada layar Edit Pos sebagai gantinya.','for item'=>'untuk item','Statuses'=>'Status','Qualification'=>'Kualifikasi','Adjustment'=>'Penyesuaian','To assign roles for bbPress forums, activate the Compatibility Pack module.'=>'Untuk menetapkan peran untuk 